import React, {useState} from "react";
import axios from "axios";
import {BrowserRouter as Router, Switch, Route, Link, useParams} from "react-router-dom";

function App() {
    const [getAllCourses, setGetAllCourses] = useState([]);
    const [degreeName, setDegreeName] = useState("");
    const [oneCourse, setOneCourse] = useState([]);

    axios.get('http://localhost:8081/getAllCourses')
        .then(res => {
            setGetAllCourses(res.data)
        });

    return (
        <Router>
            <div>
                {getAllCourses.map((eachCourse, index) => <div key={index}>
                    <div id={"deptName-" + index}><h5>{eachCourse.deptName}</h5><span></span></div>
                    <Link to={"/"+ degreeName} name={eachCourse.crawledCourses.degreeName} onClick={(e) =>{
//                        e.preventDefault();
                        setDegreeName(eachCourse.crawledCourses.degreeName.replace(/ /g, ''));
                    }}> {eachCourse.crawledCourses.degreeName} </Link>
                    <div id={"degreeType-" + index}><span>{eachCourse.degreeType}</span></div>
                    <div id={"language-" + index}><span>{eachCourse.crawledCourses.language}</span></div>
                    <div id={"uniName-" + index}><a href={eachCourse.crawledCourses.website}
                                                    target="_blank">{eachCourse.crawledCourses.uniName}</a><span></span>
                    </div>
                </div>)}
                <Switch>
                    <Route path="/:degreeName" children={<Child />} />
                </Switch>
            </div>
        </Router>
    );
}
function Child() {
    // We can use the `useParams` hook here to access
    // the dynamic pieces of the URL.
    let { degreeName } = useParams();
    return (
        <div>
            <h3>ID: {degreeName}</h3>
        </div>
    );
}

export default App;
